import { createTheme } from "@material-ui/core";

export const themes = createTheme({
    palette: {
        primary: {
            //red
            main: '#397367',
            //maroon
            temp: '#'
        },
        secondary: {
            //gray
            main: '#272424',

            temp:'#ffffff',
        },
        error: {
            main: '#f3e5f5',
        }
    },
});
